import React, { Component } from "react";
import "./App.css";
import Pokecard from "./Pokecard";

function App() {
  return (
    <div className="App">
      <Pokecard id={4} name="Charmander" type="Fire" exp={62} />
      <Pokecard id={7} name="Squirtle" type="Water" exp={63} />
    </div>
  );
}

export default App;
